        uint256 dayCountBasis = IERC7092(_bondContract).dayCountBasis();

        if(dayCountBasis == 0) {
            return 365;
        } else if(dayCountBasis == 1) {
            return 360;
        } else {
            revert("invalid day count basis value");
        }
    }
    */
}

